def feature(text: str) -> float:
    "Standard deviation of word lengths in the text considering only unique words"
    unique_words = set(text.split())
    if not unique_words:
        return 0.0
    lengths = [len(word) for word in unique_words]
    mean_length = statistics.mean(lengths)
    variance = statistics.mean((x - mean_length) ** 2 for x in lengths)
    return float(variance ** 0.5)

